    true,nt"url": null,nt"notes": "The Low Elevation Coastal Zone (LECZ) Urban-Rural
    Population and Land Area Estimates, Version 2 data nnset consists of country-level
    estimates of urban population, rural population, total population and land area
    country-wide and in LECZs for nnyears 1990, 2000, 2010, and 2100. The LECZs were
    derived from Shuttle Radar Topography Mission (SRTM), 3 arc second (~90m) data which
    were nnpost processed by ISciences LLC to include only elevations less than 20m
    contiguous to coastlines; and to supplement SRTM data in northern nnand southern
    latitudes. The population and land area statistics presented herein are summarized
    at the low coastal elevations of less than nnor equal to 1m, 3m, 5m, 7m, 9m, 10m,
    12m, and 20m. Additionally, estimates are provided for elevations > 20m, and nationally.
    The spatial nncoverage of this data set includes 202 of the 232 countries and statistical
    areas delineated in the Gridded Rural-Urban Mapping Project nnversion 1 (GRUMPv1)
    dataset. The 30 omitted areas were not included because they were landlocked, or
    otherwise lacked coastal features. nnThis data set makes use of the population inputs
    of GRUMPv1 allocated at 3 arc seconds to match the SRTM elevations, and at 30 arc
    seconds nnresolution in order to reflect uncertainty levels in the product resulting
    from the interplay of input population data resolutions (based nnon census units)
    and the elevation data.. Urban and rural areas are differentiated by the GRUMPv1
    Urban Extents. See data set documentation nnfor specifics on the methodologies used.
    This data set is produced by the Columbia University Center for International Earth
    Science nnInformation Network (CIESIN). ",nt"license_title": "U.S. Government
